import styled from 'styled-components'
import fetch from 'isomorphic-unfetch'


const Home = ({ data }) => (

  data.map(d => (
    <>
      <h1>{d.D0}</h1>
      <h1>{d.D1}</h1>
      <h1>{d.D2}</h1>
      <h1>{d.D3}</h1>
    </>
  ))

)

export async function getServerSideProps(){
  const res = await fetch('http://localhost:3001/api/university')
  const data = await res.json();

  console.log(data);

  return {props: { data } }
} 


export default Home
